import React, { Component } from "react"
 
class Blog extends Component {
  render() {
    return (
      <div>
          <h1>Need Help?</h1>
          <p>Set this up any way you want, 3 columns, whatever.  Include elements for each piece of content.</p>
       </div>
    );
  }
}
 
export default Blog;
